import React from "react";
import { Grid } from "@mui/material";

const DayDraggable = (props) => {
    return (
        <Grid container border={1}>
            <Grid item>
                <h4>{props.title}</h4>
            </Grid>
        </Grid>
    )
}

export default DayDraggable;
